import React from 'react';
import NavBar from './components/NavBar';
import WelcomeBlock from './components/WelcomeBlock';
import AboutCourceBlock from './components/AboutCourceBlock';
import PhotoBaner from './components/PhotoBaner';
import BuyCourse from './components/BuyCourse';
import BuyConfirmation from './components/BuyConfirmation';
import Caroucel from './components/Caroucel';
import Footer from './components/Footer';

import AliceCarousel from 'react-alice-carousel';

import './App.css';
import 'shorthandcss/scss/shorthand.scss';
import 'react-alice-carousel/lib/scss/alice-carousel.scss';

function App() {
  const handleDragStart = (e) => e.preventDefault();

  const items = [
    <img
      src="https://smarthamster.tech/assets/images/etherium.png"
      onDragStart={handleDragStart}
      role="presentation"
      className="c-img"
    />,
    <img
      src="https://smarthamster.tech/assets/images/etherium.png"
      onDragStart={handleDragStart}
      role="presentation"
      className="c-img"
    />,
    <img
      src="https://smarthamster.tech/assets/images/etherium.png"
      onDragStart={handleDragStart}
      role="presentation"
      className="c-img"
    />,
  ];

  return (
    <>
      <NavBar />
      <WelcomeBlock />
      <AboutCourceBlock />
      <PhotoBaner />
      <BuyCourse />
      {
        //<BuyConfirmation />
      }
      <AliceCarousel
        items={items}
        animationDuration={1000}
        autoPlay={true}
        infinite={true}
        disableDotsControls={true}
        disableButtonsControls={true}
        responsive={{
          0: {
            items: 5,
          },
          1024: {
            items: 8,
          },
        }}
      />
    </>
  );
}

export default App;
